    //         color: "white",
    //         backgroundColor: "crimson",
    //         borderRadius: "5px",
    //       }}
    //     >
    //       New Blog
    //     </Link> */}
    //   </div>
    // </nav>

    <div>
      <Navbar id="mainBar" bg="myLight" expand="md" collapseOnSelect>
        <Container>
          <Row>
            <Col className='4'>
              <Navbar.Brand>
                <img id="mainLogo" src={logo} width="60px"></img>
              </Navbar.Brand>
            </Col>

            <Col>
              <div id="logo-text">
                <h2>NETFLIX & CHILL</h2>
              </div>
            </Col>

            <Col>
              <Navbar.Toggle />
              <Navbar.Collapse id="coll">
                <Nav id="barItems">
                  <Nav.Link to="/movies/1">Home</Nav.Link>
                  <Nav.Link to="/contact">Contact</Nav.Link>
                </Nav>
              </Navbar.Collapse>
            </Col>
          </Row>
        </Container>
      </Navbar>
    </div>
  );
};

export default navbar;
